pragma solidity ^0.4.18;

import "./Signed.sol";

contract MultiSig is Signed {
    event ReceivedContribution(address indexed _contributor, uint _valueInWei);
    event ProposalSubmitted(address indexed _beneficiary, uint _valueInWei);
    event ProposalApproved(address indexed _approver, address indexed _beneficiary, uint _valueInWei);
    event ProposalRejected(address indexed _rejecter, address indexed _beneficiary, uint _valueInWei);
    event WithdrawPerformed(address indexed _beneficiary, uint _valueInWei);

    struct Prop{
        uint _value;
        uint8 signer1;
        uint8 signer2;
        uint8 signer3;
        bool hasWithdrawn;
    }


    bool isOpen;
    uint256 _balance;
    uint256 _approved;
    uint256 _proposed;

    mapping (address => uint) contributors;
    mapping (address => Prop) proposals;

    address[] openBeneficiaries;
    address[] _contributors;



   function() payable public{
        require(isOpen==false);
            require(msg.value>0);
            uint amt=contributors[msg.sender];
            if(amt==0){
                _contributors.push(msg.sender);
            }
            amt+=msg.value;
            contributors[msg.sender]=amt;

             ReceivedContribution(msg.sender,msg.value);
    }


  function endContributionPeriod() external onlySigner{
      isOpen=true;
      _balance=address(this).balance;

  }
  uint _check;
  function submitProposal(uint _valueInWei) external{
      require(isOpen==true);
      require(_valueInWei>0);
      _check=_valueInWei*100;
      _check=_check/_balance;
      require(_check<=10);
      address addr=msg.sender;
      require(_balance>=_approved+_proposed+_valueInWei);
      require(addr!=signers[0] && addr!=signers[1] &&  addr!=signers[2]);
      bool x=proposals[addr].hasWithdrawn;
      bool y=(proposals[addr].signer1==2) && (proposals[addr].signer2==2 || proposals[addr].signer3==2) || (proposals[addr].signer2==2 && proposals[addr].signer3==2);
      bool z=(proposals[addr]._value==0 && proposals[addr].signer1==0  && proposals[addr].signer2==0  && proposals[addr].signer3==0 );
      require(x || y || z);
      proposals[addr]=Prop(_valueInWei,0,0,0,false);
      _proposed=_proposed+_valueInWei;
      openBeneficiaries.push(addr);
      ProposalSubmitted(addr, _valueInWei);

  }


  function listOpenBeneficiariesProposals() external view returns (address[]){
      return openBeneficiaries;

  }

  function getBeneficiaryProposal(address _beneficiary) external view returns (uint){
      return proposals[_beneficiary]._value;
  }

  function listContributors() external view returns (address[]){
      return _contributors;
  }

  function getContributorAmount(address _contributor) external view returns (uint){
      return contributors[_contributor];
  }

  function approve(address _beneficiary) external onlySigner{
      require(proposals[_beneficiary]._value!=0);
      address _addr=msg.sender;
      if(_addr==signers[0] && proposals[_beneficiary].signer1==0){
          proposals[_beneficiary].signer1=1;
          ProposalApproved(_addr, _beneficiary, proposals[_beneficiary]._value);
      }
      else if(_addr==signers[1] && proposals[_beneficiary].signer2==0){
          proposals[_beneficiary].signer2=1;
          ProposalApproved(_addr, _beneficiary, proposals[_beneficiary]._value);
      }
      else if(_addr==signers[2] && proposals[_beneficiary].signer3==0){
          proposals[_beneficiary].signer3=1;
          ProposalApproved(_addr, _beneficiary, proposals[_beneficiary]._value);
      }
      else{
          revert();
      }
      bool z=(proposals[_beneficiary].signer1==2) && (proposals[_beneficiary].signer2==2 || proposals[_beneficiary].signer3==2) || (proposals[_beneficiary].signer2==2 && proposals[_beneficiary].signer3==2);
      bool x=(proposals[_beneficiary].signer1==1) && (proposals[_beneficiary].signer2==1 || proposals[_beneficiary].signer3==1) || (proposals[_beneficiary].signer2==1 && proposals[_beneficiary].signer3==1);
      if(x || z && openBeneficiaries.length!=0){
      uint j; uint index;
      bool check;
      if(openBeneficiaries.length==1 && openBeneficiaries[0]==_beneficiary){
         delete openBeneficiaries[openBeneficiaries.length-1];
         openBeneficiaries.length--;
         if(x){ _approved=_approved+proposals[_beneficiary]._value;
                _proposed=_proposed-proposals[_beneficiary]._value;
         }
         if(z){ _proposed=_proposed-proposals[_beneficiary]._value;}
      }else{
      for( j=0;j<=openBeneficiaries.length-1;j++){
          if(openBeneficiaries[j]==_beneficiary){
              index=j;
              check=true;
               if(x){ _approved=_approved+proposals[_beneficiary]._value;
                _proposed=_proposed-proposals[_beneficiary]._value;
                 }
               if(z){ _proposed=_proposed-proposals[_beneficiary]._value;}
                  }
      }
        if(check){
            for ( j = index; j<openBeneficiaries.length-1; j++){
                openBeneficiaries[j] = openBeneficiaries[j+1];
            }
            delete openBeneficiaries[openBeneficiaries.length-1];
            openBeneficiaries.length--;
        }

       }

  }

  }



 function reject(address _beneficiary) external onlySigner{
      require(proposals[_beneficiary]._value!=0);
      address _addr=msg.sender;
      if(_addr==signers[0] && proposals[_beneficiary].signer1==0){
          proposals[_beneficiary].signer1=2;
           ProposalRejected(_addr, _beneficiary, proposals[_beneficiary]._value);
      }
      else if(_addr==signers[1] && proposals[_beneficiary].signer2==0){
          proposals[_beneficiary].signer2=2;
          ProposalRejected(_addr, _beneficiary, proposals[_beneficiary]._value);
      }
      else if(_addr==signers[2] && proposals[_beneficiary].signer3==0){
          proposals[_beneficiary].signer3=2;
          ProposalRejected(_addr, _beneficiary, proposals[_beneficiary]._value);
      }
      else{
          revert();
      }
      bool z=(proposals[_beneficiary].signer1==2) && (proposals[_beneficiary].signer2==2 || proposals[_beneficiary].signer3==2) || (proposals[_beneficiary].signer2==2 && proposals[_beneficiary].signer3==2);
      bool x=(proposals[_beneficiary].signer1==1) && (proposals[_beneficiary].signer2==1 || proposals[_beneficiary].signer3==1) || (proposals[_beneficiary].signer2==1 && proposals[_beneficiary].signer3==1);
      if(x || z && openBeneficiaries.length!=0){
      uint j; uint index;
      bool check;
      if(openBeneficiaries.length==1 && openBeneficiaries[0]==_beneficiary){
         delete openBeneficiaries[openBeneficiaries.length-1];
         openBeneficiaries.length--;
         if(x){ _approved=_approved+proposals[_beneficiary]._value;
                _proposed=_proposed-proposals[_beneficiary]._value;
         }
         if(z){ _proposed=_proposed-proposals[_beneficiary]._value;}
      }else{
      for( j=0;j<=openBeneficiaries.length-1;j++){
          if(openBeneficiaries[j]==_beneficiary){
              index=j;
              check=true;
               if(x){ _approved=_approved+proposals[_beneficiary]._value;
                _proposed=_proposed-proposals[_beneficiary]._value;
                 }
               if(z){ _proposed=_proposed-proposals[_beneficiary]._value;}
                  }
      }
        if(check){
            for ( j = index; j<openBeneficiaries.length-1; j++){
                openBeneficiaries[j] = openBeneficiaries[j+1];
            }
            delete openBeneficiaries[openBeneficiaries.length-1];
            openBeneficiaries.length--;
        }

       }

  }

  }

  function withdraw(uint _valueInWei) external{
    address addr=msg.sender;
    require(proposals[addr]._value!=0);  
    require(proposals[addr].signer1==1 && (proposals[addr].signer2==1 || proposals[addr].signer3==1) || (proposals[addr].signer2==1 && proposals[addr].signer3==1));
    require(_valueInWei<address(this).balance);
    require(_valueInWei<=proposals[addr]._value);
    require(proposals[addr].hasWithdrawn!=true);
    addr.transfer(_valueInWei);
    if(_valueInWei==proposals[addr]._value){
        proposals[addr].hasWithdrawn=true;
    }else{
        proposals[addr]._value=proposals[addr]._value -_valueInWei;
    }
     WithdrawPerformed(msg.sender, _valueInWei);

  }



  function owner() external view returns(address){
      return creator;
  }
  function open() external view returns(bool){
      return isOpen;
  }
  function getBal() external view returns(uint){
      return address(this).balance;
  }
  function getcheckl() external view returns(uint){
      return _check;
  }

  function getBalance() external view returns(uint){
      return _balance;
  }
  function getApproved() external view returns(uint){
      return _approved;
  }
  function getProposed() external view returns(uint){
      return _proposed;
  }

  function getSignerVote(address _signer, address _beneficiary) view external returns(uint){
      require(_signer==signers[0] || _signer==signers[1] || _signer==signers[2]);
      require(proposals[_beneficiary]._value!=0);
      if(_signer==signers[0]){
         return uint(proposals[_beneficiary].signer1);
      }
      else if(_signer==signers[1]){
       return uint(proposals[_beneficiary].signer2);
      }
      else{
         return uint(proposals[_beneficiary].signer3);
      }

  }


}
